package com.telenav.cache;

import java.util.Vector;

public abstract class AbstractCache
{
    public abstract void clear();
    public abstract boolean containsKey(Object key);
    public abstract boolean containsValue(Object value);
    public abstract Object get(Object key);
    public abstract Object put(Object key, Object value);
    public abstract void putAll(AbstractCache cache);
    public abstract Object remove(Object key);

    public abstract Vector elements();
    public abstract void elements(Vector v);
    public abstract Vector keys();
    public abstract void keys(Vector v);
    public abstract int size();
    public abstract int getMaxSize();
}
